import React from 'react';
import './Skills.css';

const Skills: React.FC = () => {
  return (
    <div style={{ height: '100vh', paddingTop: '60px' }}>
      <h1>Skills</h1>
      <p>Skills section content.</p>
    </div>
  );
}

export default Skills;
